// DashboardContainer.js
import React from 'react';
import NavigationBar from './NavigationBar';
import SideMenu from './SideMenu';

const DashboardContainer = ({ children }) => {
  return (
    <div>
      <NavigationBar />
      <SideMenu />
      <main>{children}</main>
    </div>
  );
};

export default DashboardContainer;
